export default class SideNav extends Component {
    constructor(props) {
        super(props)

        this.state = {
             open: false
        }
    }

    render() {

        const button = <button > X </button>

        const side = <div>

                            side nav showing 

                     </div>


        const showing = this.state.open ? button : side

        return (
            <div> 
                {showing}
            </div>
        )
    }
}
